    <div className="" >
      <div className="home">
      <p>HI, I'M shivam singh </p>
      <div>
        <h1>FRONTEND REACT DEVELOPER</h1>
      </div>
      <div>
        <button className="btn yellow">Project</button>
        <button className=" btn">Contact</button>
      </div>
      </div>
      <Footer/>
    </div>
  );
}

export default Home;
